const About = () => {
    return (
        <div id="about">
            <h2>Freshly Made Delicacies from Our Kitchen to Your Plates</h2>
            <p>We offer a variety of authentic Hyderabadi dishes, prepared fresh and ready for pickup every weekend...</p>
        </div>
